class ExtractedTextWindow(QMainWindow):

    def __init__(self):
        super().__init__()
        self.init_ui()
        self.doc = None
        self.page_number = 0
        self.start_coordinates = None
        self.end_coordinates = None
        self.selection_rect_item = None

    def init_ui(self):
        self.setWindowTitle("PDF Splitter")
        # self.setGeometry(100, 100, 660, 820)
        self.setGeometry(560, 60, 700, 720)
        
        # Logo
        pixmap = QPixmap()
        pixmap.loadFromData(QByteArray.fromBase64(base64_image))
        self.setWindowIcon(QIcon(pixmap))

        layout = QVBoxLayout()

        #------pdf 
        self.pdf_label = QLabel()
        self.pdf_label.setScaledContents(True)

        # Create a QScrollArea and add the QLabel to it
        self.scroll_area = QScrollArea()
        self.scroll_area.setWidget(self.pdf_label)
        self.scroll_area.setAlignment(Qt.AlignmentFlag.AlignCenter)

        # Set margins and size policy
        self.scroll_area.setContentsMargins(500, 450, 150, 150)
        self.scroll_area.setWidgetResizable(True)  # Ensure the widget is resizable
        layout.addWidget(self.scroll_area)

        # Extracted text and cordinates
        self.extracted_text_label = QLabel()
        self.extracted_text_label.setAlignment(Qt.AlignmentFlag.AlignTop)
        self.extracted_text_label.setText("<p style='color:red; font-size: 16px'>*click and drag your mouse cursor to select the text you want to use as the filename.</p>")
        self.extracted_text_label.setHidden(True)
        layout.addWidget(self.extracted_text_label)

        horizontal_layout = QHBoxLayout()

        # Total pages in doc
        label_total = QLabel("Total no of Pages in this Document: ")
        horizontal_layout.addWidget(label_total)

        self.rec_count_doc = QTextEdit(self)
        self.rec_count_doc.setFixedHeight(30)  
        self.rec_count_doc.setFixedWidth(50)
        self.rec_count_doc.setPlaceholderText("NA")
        self.rec_count_doc.setReadOnly(True)
        horizontal_layout.addWidget(self.rec_count_doc)

        # prefix
        label = QLabel("Prefix for PDF Name: ")
        horizontal_layout.addWidget(label)

        self.text_box = QTextEdit(self)
        self.text_box.setFixedHeight(30)  # Set the height of the text box
        horizontal_layout.addWidget(self.text_box)

        layout.addLayout(horizontal_layout)


        adjust_btn_H = QHBoxLayout()

        # Open PDF
        self.open_button = QPushButton('Open PDF')
        self.open_button.clicked.connect(self.open_pdf_and_display)
        adjust_btn_H.addWidget(self.open_button)
        # layout.addWidget(self.open_button)

        # Next Page
        self.next_button = QPushButton('Next Page')
        self.next_button.clicked.connect(self.next_page)
        adjust_btn_H.addWidget(self.next_button)
        # layout.addWidget(self.next_button)

        # Split
        self.submit_button = QPushButton("Split")
        self.submit_button.clicked.connect(self.split_pdf)
        adjust_btn_H.addWidget(self.submit_button)
        # layout.addWidget(self.submit_button)

        layout.addLayout(adjust_btn_H)

        self.central_widget = QWidget()
        self.setCentralWidget(self.central_widget)
        self.central_widget.setLayout(layout)

        self.selected_pdf_path = ""

        # Load the custom cursor pixmap with a "+" sign
        cursor_pixmap = QPixmap(24, 24)
        cursor_pixmap.fill(Qt.GlobalColor.transparent)
        painter = QPainter(cursor_pixmap)
        painter.setPen(QColor(Qt.GlobalColor.black))
        painter.drawLine(0, 12, 24, 12)
        painter.drawLine(12, 0, 12, 24)
        painter.end()

        
        # Create a custom cursor with the pixmap
        self.custom_cursor = QCursor(cursor_pixmap)

        self.setStyleSheet("""
            QMainWindow {
                background-color:#f5f5f5; /* White background */
            }
            QLineEdit {
                background-color: white;
                border: 1px solid #ccc; /* Light Gray border */
                padding: 4px;
                width: 150px; /* Adjust as needed */
            }
            QPushButton {
                background-color: #0d6efd; /* Dark Blue button */
                color: white;
                border: none;
                padding: 6px 12px;
                border-radius: 3px;
                width: 150px;
            }
            QPushButton:hover {
                background-color: #0951ba; /* Slightly darker grey on hover */
            }
        """)

    def open_pdf_and_display(self):
        dialog = QFileDialog(self)
        options = dialog.options()
        file_path, _ = dialog.getOpenFileName(self, "Select PDF File", "", "PDF Files (*.pdf);;All Files (*)", options=options)
        if file_path:
            self.selected_pdf_path = file_path
            self.doc = fitz.open(file_path)
            self.rec_count_doc.setPlainText(str(len(self.doc)))
            self.extracted_text_label.setVisible(True)
            self.page_number = 0
            self.display_pdf_page()

    def display_pdf_page(self):
        if self.doc:
            page = self.doc.load_page(self.page_number)
            image = page.get_pixmap()
            width, height = image.width, image.height
            qimage = QImage(image.samples, width, height, image.stride, QImage.Format.Format_RGB888)
            pixmap = QPixmap.fromImage(qimage)

            painter = QPainter(pixmap)
            if self.start_coordinates and self.end_coordinates:
                # Draw a border around the selected area
                x1, y1, _, _ = self.start_coordinates
                x2, y2, _, _ = self.end_coordinates
                x, y, w, h = (min(x1, x2)-10), (min(y1, y2)-10), abs(x2 - x1), abs(y2 - y1)
                painter.setPen(QColor('red'))
                painter.drawRect(QRect(int(x), int(y), int(w), int(h)))
            painter.end()

            self.pdf_label.setPixmap(pixmap)

    def next_page(self):
        if self.doc and self.page_number < self.doc.page_count - 1:
            self.page_number += 1
            self.display_pdf_page()

    def mousePressEvent(self, event):
        self.start_coordinates = self.map_to_pdf_coordinates(event.pos())
        self.end_coordinates = self.start_coordinates

        # Set the custom cursor with a "+" sign
        self.setCursor(self.custom_cursor)

        # Remove the previous selection rectangle
        if self.selection_rect_item:
            self.selection_rect_item.setParent(None)
            self.selection_rect_item = None

        self.display_pdf_page()

    def mouseMoveEvent(self, event):
        if self.start_coordinates:
            self.end_coordinates = self.map_to_pdf_coordinates(event.pos())

            # Remove the previous selection rectangle
            if self.selection_rect_item:
                self.selection_rect_item.setParent(None)
                self.selection_rect_item = None

            self.display_pdf_page()

    def map_to_pdf_coordinates(self, pos):
        # Get the scaling factors
        scale_width = self.pdf_label.pixmap().width() / self.pdf_label.width()
        scale_height = self.pdf_label.pixmap().height() / self.pdf_label.height()

        # Map the mouse position to PDF content
        mapped_x = pos.x() * scale_width
        mapped_y = pos.y() * scale_height

        # Add the current scroll position
        mapped_x += self.scroll_area.horizontalScrollBar().value()
        mapped_y += self.scroll_area.verticalScrollBar().value()

        return (mapped_x, mapped_y, mapped_x, mapped_y)


    def mouseReleaseEvent(self, event):
        # Extract text using self.start_coordinates and self.end_coordinates
        if self.start_coordinates and self.end_coordinates:
            extracted_text, coords = self.extract_text_from_coordinates()
            self.display_extracted_text(extracted_text, coords)

        self.unsetCursor()

    def extract_text_from_coordinates(self):
        if self.doc and self.start_coordinates and self.end_coordinates:
            x1, y1, _, _ = self.start_coordinates
            x2, y2, _, _ = self.end_coordinates
            x, y, w, h = (min(x1, x2)-10), (min(y1, y2)-10), abs(x2 - x1), abs(y2 - y1)
            area_rect = fitz.Rect(x, y, x + w, y + h)
            cordss = x, y, x + w, y + h
            page = self.doc.load_page(self.page_number)
            selected_text = page.get_text("text", clip=area_rect)
            return selected_text, cordss

        return "", ""

    def display_extracted_text(self, text, coords):
        cleaned_text = "".join(char if char.isalnum() else "" for char in text.strip())
        self.extracted_text_label.setText(f"<p style='font-size: 14px;'>Extracted Text :- <span style='color : green; font-weight: bold;'>{cleaned_text}</span>\t\t Coordinates :- <span style='color : green; font-weight: bold;'>{coords}</span></p>")
        

    def split_pdf(self):
        if self.selected_pdf_path:
            current_dir = os.getcwd()

            prefix=self.text_box.toPlainText()

            # Check if 'pdf_files' directory exists, and if not, create it
            output_directory = os.path.join(current_dir, 'pdf_files')
            if not os.path.exists(output_directory):
                os.makedirs(output_directory)

            extracted_text, coords = self.extract_text_from_coordinates()
            if extracted_text and coords:
                split_pdf1(self.selected_pdf_path, output_directory, coords, prefix)
            else:
                show_warning_message("Please click and drag your mouse cursor to select the text you want to use as the filename. To rename a PDF after splitting.")
        else:    
            show_warning_message("Please... Select the PDF to Proceed.")

def extract_filename_without_extension(file):
    filename, extension = os.path.splitext(file)
    return filename

def show_success_message1(message):
    success_msg_box = QMessageBox()
    success_msg_box.setIcon(QMessageBox.Information)
    success_msg_box.setWindowTitle("Success")
    success_msg_box.setText(message)
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64_image))
    success_msg_box.setWindowIcon(QIcon(pixmap))
    success_msg_box.setStandardButtons(QMessageBox.Ok)
    success_msg_box.exec()

def show_warning_message(message):
    success_msg_box = QMessageBox()
    success_msg_box.setIcon(QMessageBox.Warning)
    success_msg_box.setWindowTitle("Warning")
    success_msg_box.setText(message)
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64_image))
    success_msg_box.setWindowIcon(QIcon(pixmap))
    success_msg_box.setStandardButtons(QMessageBox.Retry)
    success_msg_box.exec()


